import React from 'react';
import './classCss.css';
import {  Link } from 'react-router-dom';
import {rootConstants} from '../_constants';
import { connect } from 'react-redux';
import  history  from '../_store/history';
import schoolData from '../_data/schoolData';
import PlanPrint from '../_components/_lessonPlan/planPrint';
import {allActions} from '../_actions'
import { Grid } from 'gymnast';
import GridLayout from 'react-grid-layout';


class classScreen extends React.Component {

    constructor(props) {
        super(props);
        this.handleClick = this.handleClick.bind(this);
        this.state = {
          isState: false
        };
      }


      handleClick(data, islog) {
        if(islog){
          this.props.modalSchoolFalse(data)
        }else{
          this.props.newSchoolName(data)
        }

      }

      render() {
        const person = ["a","c","d"];
        const person1 = ["s","aa","dd"];

        return (

          <Grid className="divCss">
            <GridLayout className="layout" cols={12} rowHeight={30} width={1300}>
            <div style={{background:"red"}} key="d" data-grid={{x: 0, y: 0, w: 3, h: 1}}>a</div>
            <div style={{background:"red"}} key="2" data-grid={{x: 0, y: 0, w: 3, h: 1}}>a</div>
            <div style={{background:"red"}} key="d22" data-grid={{x: 0, y: 0, w: 3, h: 1}}>a</div>
            <div style={{background:"red"}} key="d3" data-grid={{x: 0, y: 0, w: 3, h: 1}}>a</div>

              <Grid className="" size={3}><PlanPrint  data={person}></PlanPrint></Grid>
              <Grid className="" size={3}><PlanPrint  data={person1}></PlanPrint></Grid>
              <Grid className="" size={3}></Grid>
              <Grid className="" size={3}>114</Grid>

              <Grid className="" size={3}>115</Grid>
              <Grid className="" size={3}>1176</Grid>
              <Grid className="" size={3}>117</Grid>
              <Grid className="" size={3}>118</Grid>

            </GridLayout>
        </Grid>

        )

    }
}


export default connect(allActions.mapStateToProps,allActions.mapDispatchToProps)(classScreen);
